    let date = DATE_FORMAT.to_date(SCHD_CALLS.data[i].SCHEDULE_DATE);
    if (date == DATE_FORMAT.get_today() && SCHD_CALLS.data[i].REMARK == "RNR" || SCHD_CALLS.data[i].REMARK == "CALL BACK") {
      showModal("Modal2");
    }
  }
}

